import React from 'react';
// import styled from 'styled-components'
// import images from './Images'
import { Gallery, GalleryImage } from 'react-gesture-gallery'

const images = [{
  url : "https://drive.google.com/open?id=17jm5rV4e5tCbYhuPrRc6vNXP-lSHxspB",
  brand : "CYZONE" 
},{
  url : "https://drive.google.com/file/d/1dPwnQ0rx_0EY4TYpf342PfJwvGxShdCH/view?usp=sharing",
  brand : "CYZONE"
},{
  url : "https://drive.google.com/file/d/1jsGJGfeW4PgO96qSPLstbMZRP3EbqM6N/view?usp=sharing",
  brand : "ESIKA"
},{
  url : "https://drive.google.com/file/d/1xSebzODIEnVQu2CZYYciN8Yoao9iKAeq/view?usp=sharing",
  brand : "ESIKA"
},{
  url : "https://drive.google.com/file/d/1Uks9RKH_HixPEkAUch1u_nF-I3dZvlc8/view?usp=sharing",
  brand : "ESIKA"
}];

export const Slider = () => {
  return(
    <Gallery index={0}>
      {images.map((img) => {
        <GalleryImage src={img.url}/>

      })}
    </Gallery>
  )
};
